import Header from "../Layout/Header";
import Sidebar from "../Layout/Sidebar";
import { Outlet } from "react-router-dom";

const RootLayout = () =>{
    return(
        <div>
            <section>
                <div className="w-20">
                <Header />
                </div>
            </section> 
            <section>
                <div className="grid grid-cols-12">
                    <div className="col-span-3 bg-slate-400 h-screen pl-2">
                        <Sidebar />
                    </div>
                    <main className="col-span-9 bg-green-500 h-screen pl-2">
                        <Outlet />
                
                    </main>
                </div>
            </section>
        </div>
    )
}

export default RootLayout;
